import React, { Component } from "react";
import Axios from "axios";
import "./law_report.css";

class law_report extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
    };
  }
  componentDidMount = () => {
    Axios.get("/lawyersReporter").then(({ data }) => {
      this.setState({
        kind: data.kind,
        data: data.data.children,
      });
      //console.log(response.data.tem_c);
      //console.log(response.data.json());
      //fetch();
    });
  };

  render() {
    return <div className="topic">LIST OF LAWYERS</div>;
  }
}

export default law_report;
